import React from 'react'
import media from 'media'
const Item = (props) => {
    console.log('====================================');
    console.log(props.image);
    console.log('====================================');
    return (
        <div>
            <span>{props.brand}</span>
            <span>{props.title}</span>
            <span>{props.price}</span>
            <img src={require(`../media/${props.image}`)} alt="image" />
        </div>
    )
}

export default Item
